import React from 'react';
import './ListaAlunos.css';
import alunos from '../../data/alunos';

export default (props) => {
  const list = <li>{alunos[0].id} {alunos [0].nome} -> {alunos [0].nota}</li>;
  return (
    <div>
      <ul>
        <li>Ana - 9.7</li>
        <li>Carlos - 7.7</li>
        <li>Daniel - 6.5</li>
        <li>Rodrigo - 9.2</li>
        <li>Carolina - 6.9</li>
        <li>João - 5.5</li>
      </ul>
    </div>
  );
};
